import React from "react";
import {
  Card,
  CardHeader,
  CardContent,
  CardActions,
  Typography,
  List,
  ListItem,
  ListItemText,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/styles";
import { UnitTemplate } from "./UnitTemplate";

const cardStyle = makeStyles({});

function SingleUnitBlock() {
  return (
    <div>
      <Card>
        <CardContent>
          <List>
            {UnitTemplate.map((val, key) => (
                <ListItem button key={key}>
                    <ListItemText>{val.title}</ListItemText>
                </ListItem>
            ))}

          </List>
        </CardContent>
      </Card>
    </div>
  );
}

export default SingleUnitBlock;
